"""
Module: multimodal_handlers

Provides input/output handlers for multimodal data (images and audio).
Supports image processing with PIL/OpenCV and audio processing with librosa.
"""

import io
import base64
import logging
import numpy as np
from typing import Dict, Any, Optional, Union, Tuple
from pathlib import Path

logger = logging.getLogger(__name__)

# Image handling
try:
    from PIL import Image
    PIL_AVAILABLE = True
except ImportError:
    PIL_AVAILABLE = False
    logger.warning("PIL not available. Image processing will be limited.")

try:
    import cv2
    CV2_AVAILABLE = True
except ImportError:
    CV2_AVAILABLE = False
    logger.warning("OpenCV not available. Advanced image processing will be limited.")

# Audio handling
try:
    import librosa
    import soundfile as sf
    LIBROSA_AVAILABLE = True
except ImportError:
    LIBROSA_AVAILABLE = False
    logger.warning("librosa/soundfile not available. Audio processing will be limited.")

try:
    import pyaudio
    PYAUDIO_AVAILABLE = True
except ImportError:
    PYAUDIO_AVAILABLE = False
    logger.warning("PyAudio not available. Real-time audio capture will be limited.")


class ImageInputHandler:
    """Handles image input from various sources."""

    @staticmethod
    def load_from_path(image_path: str):
        """Load an image from a file path."""
        if not PIL_AVAILABLE:
            logger.error("PIL not available")
            return None
        try:
            img = Image.open(image_path)
            logger.info(f"Loaded image from {image_path}, size: {img.size}")
            return img
        except Exception as e:
            logger.error(f"Error loading image: {e}")
            return None

    @staticmethod
    def extract_features(image) -> Dict[str, Any]:
        """Extract basic features from an image."""
        features = {
            "size": image.size,
            "mode": image.mode,
            "width": image.width,
            "height": image.height,
        }
        return features


class AudioInputHandler:
    """Handles audio input from various sources."""

    @staticmethod
    def load_from_path(audio_path: str, sr=None, mono=True):
        """Load audio from a file path."""
        if not LIBROSA_AVAILABLE:
            logger.error("librosa not available")
            return None
        try:
            audio, sample_rate = librosa.load(audio_path, sr=sr, mono=mono)
            logger.info(f"Loaded audio from {audio_path}, shape: {audio.shape}")
            return audio, sample_rate
        except Exception as e:
            logger.error(f"Error loading audio: {e}")
            return None

    @staticmethod
    def extract_features(audio: np.ndarray, sr: int) -> Dict[str, Any]:
        """Extract audio features."""
        if not LIBROSA_AVAILABLE:
            return {}
        features = {
            "duration": float(len(audio) / sr),
            "sample_rate": sr,
        }
        return features


class ImageOutputGenerator:
    """Generates image outputs."""

    @staticmethod
    def save_to_path(image, output_path: str, format: str = 'PNG') -> bool:
        """Save an image to a file."""
        try:
            Path(output_path).parent.mkdir(parents=True, exist_ok=True)
            image.save(output_path, format=format)
            logger.info(f"Saved image to {output_path}")
            return True
        except Exception as e:
            logger.error(f"Error saving image: {e}")
            return False


class AudioOutputGenerator:
    """Generates audio outputs."""

    @staticmethod
    def save_to_path(audio: np.ndarray, sr: int, output_path: str, format: str = 'WAV') -> bool:
        """Save audio to a file."""
        if not LIBROSA_AVAILABLE:
            logger.error("soundfile not available")
            return False
        try:
            Path(output_path).parent.mkdir(parents=True, exist_ok=True)
            sf.write(output_path, audio, sr, format=format)
            logger.info(f"Saved audio to {output_path}")
            return True
        except Exception as e:
            logger.error(f"Error saving audio: {e}")
            return False

